import axios from "axios";
const API_URL = "http://localhost:8080/api/profile";

class MessageService {
  post(text) {
    return axios
      .post(API_URL, { text })
      .then()
      .catch((e) => {
        console.log(e);
      });
  }
}
// eslint-disable-next-line
export default new MessageService();
